import React from 'react'
import {useEffect, useState} from "react";

function Home(){
    const [message, setMessage] = useState([]);

    useEffect(() => {
        fetch("/hello")
            .then((response) => {
                return response.json();
            })
            .then(function (data) {
                setMessage(data);
            });
    }, []);

    return (
        <div>
            <ul>
                {message.map((text, index) => <li key={`${index}-${text}`}>{text}</li>)}
            </ul>
        </div>
    )
}

export default Home;
